// @ts-check

module.exports = {
  ignorePatterns: [
    '**/storefront-api-types.ts',
    '**/storefront-api-types.d.ts',
    'examples/**',
  ],
  root: true,
  plugins: ['eslint-plugin-tsdoc'],
  extends: [
    'plugin:node/recommended',
    'plugin:hydrogen/recommended',
    'plugin:hydrogen/typescript',
  ],
  parserOptions: {
    sourceType: 'module',
    ecmaVersion: 2020,
  },
  rules: {
    'jest/no-disabled-tests': 'off',
    'jest/no-export': 'off',
    'jsx-a11y/iframe-has-title': 'off',
    'no-console': 'off',
    'no-constant-condition': 'off',
    'jest/no-done-callback': 'off',
    'tsdoc/syntax': 'error',
    'node/no-missing-import': [
      'error',
      {
        allowModules: ['types', 'testUtils', '@shopify/hydrogen'],
        tryExtensions: ['.ts', '.js', '.jsx', '.tsx', '.d.ts'],
      },
    ],
    'node/no-extraneous-import': [
      'error',
      {
        allowModules: ['@shopify/hydrogen', '@shopify/react-testing'],
      },
    ],
    'node/no-extraneous-require': [
      'error',
      {
        allowModules: ['@shopify/hydrogen'],
      },
    ],
    'node/no-unpublished-import': 'off',
    'node/no-unsupported-features/es-syntax': 'off',
    'node/no-unsupported-features/es-builtins': [
      'error',
      // We need to manually specify a min-version since we can't use `engine`
      {
        version: '>=14.0.0',
        ignores: [],
      },
    ],
    'node/no-unsupported-features/node-builtins': [
      'error',
      // We need to manually specify a min-version since we can't use `engine`
      {
        version: '>=14.0.0',
        ignores: [],
      },
    ],
    'prefer-const': [
      'warn',
      {
        destructuring: 'all',
      },
    ],
    '@typescript-eslint/ban-types': 'off',
    '@typescript-eslint/ban-ts-comment': 'off',
    '@typescript-eslint/naming-convention': 'off',
    '@typescript-eslint/no-namespace': 'off',
    '@typescript-eslint/no-empty-function': 'off',
  },
  overrides: [
    {
      files: ['packages/eslint-plugin/**'],
      rules: {
        'hydrogen/server-component-banned-hooks': 'off',
        'hydrogen/prefer-image-component': 'off',
        'jsx-a11y/img-redundant-alt': 'off',
        'no-prototype-builtins': 'off',
      },
    },
    {
      files: ['packages/hydrogen/**'],
      rules: {
        'hydrogen/prefer-gql': 'off',
      },
    },
    {
      files: ['packages/playground/**'],
      rules: {
        'node/no-extraneous-import': 'off',
        'node/no-extraneous-require': 'off',
      },
    },
    {
      files: ['**/*.example.*'],
      rules: {
        'react/react-in-jsx-scope': 'off',
        'react-hooks/exhaustive-deps': 'off',
        'react/jsx-key': 'off',
        'react-hooks/rules-of-hooks': 'off',
        'node/no-extraneous-import': 'off',
        'node/no-missing-import': 'off',
      },
    },
  ],
};

// eslint-disable-next-line node/no-extraneous-import
import type {Config} from '@jest/types';

const config: Config.InitialOptions = {
  preset: 'ts-jest',
  testMatch: ['**/playground/**/*.(spec|test).[jt]s?(x)'],
  testTimeout: process.env.CI ? 45000 : 10000,
  watchPathIgnorePatterns: ['<rootDir>/temp'],
  globalSetup: './scripts/jest-e2e-global-setup.ts',
  globalTeardown: './scripts/jest-e2e-global-teardown.ts',
  testEnvironment: './scripts/jest-e2e-env.js',
  setupFilesAfterEnv: ['./scripts/jest-e2e-suite-setup.ts'],
  globals: {
    'ts-jest': {
      tsconfig: './packages/playground/tsconfig.json',
    },
  },
  moduleNameMapper: {
    // captures the module name with '.js', and removes the '.js' part so that the module resolver can find the '.ts' file
    '^(\\.{1,2}/.*)\\.js$': '$1',
  },
};

export default config;

// @ts-nocheck
import '@shopify/react-testing';
import '@shopify/react-testing/matchers';
import './scripts/polyfillWebRuntime';

// TODO remove all these mocks when @shopify/react-testing supports React 18 experimental

globalThis.IS_REACT_ACT_ENVIRONMENT = true;

globalThis.scrollTo = () => null;

jest.mock('react-dom', () => {
  const reactDom = jest.requireActual('react-dom');
  const reactDomClient = jest.requireActual('react-dom/client');

  return {
    ...reactDom,
    render: (app, container) => {
      // @ts-ignore
      const root = reactDomClient.createRoot(container);
      container.__unmount = root.unmount.bind(root);
      root.render(app);
    },
    unmountComponentAtNode(container) {
      container.__unmount();
    },
  };
});

jest.mock('@shopify/react-testing/build/cjs/compat.js', () => {
  return {
    getInternals: (instance: any) => {
      const internals = instance._reactInternals;

      if (internals) {
        internals.alternate = internals.alternate || internals;
      }

      return internals;
    },
  };
});

// eslint-disable-next-line node/no-extraneous-import
import type {Config} from '@jest/types';

const config: Config.InitialOptions = {
  preset: 'ts-jest',
  testMatch: [
    '**/*.(spec|test).[jt]s?(x)',
    '!**/*/dist/**/*',
    '!**/*/fixtures/**/*',
  ],
  testPathIgnorePatterns: [
    '<rootDir>/packages/playground/*',
    '<rootDir>/examples/*',
    '<rootDir>/templates/*',
  ],
  testTimeout: process.env.CI ? 45000 : 10000,
  watchPathIgnorePatterns: ['<rootDir>/temp', 'fixtures'],
  setupFilesAfterEnv: ['<rootDir>/jest-setup.ts'],
  globals: {
    __HYDROGEN_DEV__: true,
    __HYDROGEN_TEST__: true,
    __HYDROGEN_CACHE_ID__: '"__QUERY_CACHE_ID__"',
    'ts-jest': {
      tsconfig: './packages/hydrogen/tsconfig.json',
    },
  },
  collectCoverageFrom: [
    'packages/hydrogen/**/*.{ts,tsx}',
    '!packages/hydrogen/**/*.d.{ts,tsx}',
    '!packages/hydrogen/src/graphql/**/*',
    '!packages/hydrogen/node_modules/**/*',
    '!packages/hydrogen/dist/**/*',
  ],
  coverageDirectory: 'coverage',
  coverageReporters: ['html-spa', 'text-summary'],
  moduleNameMapper: {
    // captures the module name with '.js', and removes the '.js' part so that the module resolver can find the '.ts' file
    '^(\\.{1,2}/.*)\\.js$': '$1',
  },
};

export default config;
